import pyfiglet
import colorama
from colorama import Fore,Style,Back
import time
import sys

def s(text, delay=0.011):
    """Print text one character at a time to simulate typing."""
    for char in text:
        sys.stdout.write(char)
        sys.stdout.flush()
        time.sleep(delay)  # Pause between characters
    print()

